import React from 'react'
import { Outlet, Link } from "react-router-dom";
function App() {

  return (
    <div className='container-fluid h-10'>
      <nav>
      <Link to="/">Home</Link>
      <Link to="/authen">Authen</Link>
      </nav>
      <Outlet />
    </div>
  )
}

export default App
